import React, { Component } from "react";
import styled from "styled-components";
import Header1 from "../../../src/components/Header1";
import Header2 from "../../../src/components/Header2";

const Container = styled.div`

`;

const InnerContainer1 = styled.div`

`;

const Heading = styled.h1`

`;

const InnerContainer2 = styled.div`

`;

const Label = styled.label`

`;

const Input = styled.input`

`;

const Button = styled.button`

`;

class SigupDraft extends Component {
    render() {
        return(
            <Container>
                <Header1 />
                <Header2 />
                <InnerContainer1>
                    <Heading>Registration</Heading>
                    <Label>Username</Label>
                    <Input><input type="text"/></Input>
                    <Label><label>Password</label></Label>
                    <Input><input type="text"/></Input>
                    <Button><button> Register </button></Button>
                </InnerContainer1>
                <InnerContainer2>
                    <Heading>Login</Heading>
                    <Input><input type="text" placeholder="Username"/></Input>
                    <Input><input type="password" placeholder="Password"/></Input>
                    <Button><button> Login </button></Button>
                </InnerContainer2>
            </Container>
        )
    }
}

export default SigupDraft;
